import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchPriorities } from '../updateKPI/PrioritySlice';

export const PriorityList = () => {
  const dispatch = useDispatch();
  const { priorities, loading, error } = useSelector((state) => state.priority);

  useEffect(() => {
    const startDate = '2012-07-01';
    const endDate = '2025-01-01';
    dispatch(fetchPriorities({ start_date: startDate, end_date: endDate }));
  }, [dispatch]);

  return (
    <div>
      <h2>Priorities</h2>
      {loading && <p>Loading...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <ul>
        {priorities.map((priority) => (
          <li key={priority.id}>{priority.priority_name}</li>
        ))}
      </ul>
    </div>
  );
};
